  \"2016-11-25T21:06:10.009369\",\n\t\"name\": \"edfacts-migrant-education-program-201112\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Migrant Education Program, 2011-12
  (EDFacts MEP:2011-12), is one of 17 'topics' identified in the EDFacts documentation
  (in this database, each 'topic' is entered as a separate study); program data is
  available since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts MEP:2011-12 (ed.gov/about/inits/ed/edfacts)
  annually collects cross-sectional data from states to support oversight and reporting
  of the Migrant Education Program (MEP) about students eligible for funding and students
  served under the migrant student program at the school, LEA, and state levels. EDFacts
  MEP:2011-12 data were collected using the EDFacts Submission System (ESS), a centralized
  portal and their submission by states is mandatory and required for benefits. Not
  submitting the required reports by a state constitutes a failure to comply with
  law and may have consequences for federal funding to the state. Key statistics produced
  from EDFacts MEP:2011-12 are from 10 data groups on Consolidated MEP Funds Status,
  MEP Personnel (FTE), MEP Personnel (Headcount), MEP Services, MEP Students Eligible
  and Served -Summer/Intersession, MEP Students Served - 12 - Month, MEP Students
  Served - Regular School Year, MEP Students Served - Summer/Intersession, Migrant
  Students Eligible - 12 - Month, and Migrant Students Eligible - Regular School Year.
  For the purposes of this system, data groups are referred to as 'variables', as
  a result of the structure and format of EDFacts' data.\",\n\t\"license_title\":
